type: object
properties:
  rawData:
    type: string
  suIds:
    type: array
    items:
      type: string
  header:
    type: string
  priority:
    type: string
    enum:
      - EMERGENCY
      - URGENT
      - NORMAL
      - DEFERRED
  priorityValue:
    type: string
  addresses:
    type: array
    items:
      $ref: ./AddressDto.yaml
  originator:
    $ref: ./OriginatorDto.yaml
  doubleSignature:
    type: string
  messageIdentify:
    type: string
  possibleDuplicate:
    type: boolean
  messageType:
    type: string
  messageBody:
    type: string
  errors:
    type: array
    items:
      type: string
